import './App.css';
import React from 'react';
import { Form , Input , Button } from 'antd';
import FormItem from 'antd/es/form/FormItem';
import { useNavigate } from 'react-router-dom';


function App() {

  const navigate = useNavigate();

  function handleClick() {
    navigate("/dasboard.js")
  }

  return (
    <div className="App">

     <Form>
      <FormItem label="User Name" name ="username">
        <Input placeholder='User Name' required></Input>
      </FormItem>
      <FormItem label="Password" name ="password">
        <Input placeholder='Password 'required></Input>
      </FormItem>
      <FormItem>
        <Button block type='primary' onClick={ handleClick()}>Log in</Button>
        </FormItem>
     </Form>
    </div>
  );

}

export default App;
